const gasBuffer = 1e5;

function connectToContracts(web3, chain) {
	if( chain == 'kovan' ){
		const Tub = new web3.eth.Contract(tubAbi.abi, '0xa71937147b55deb8a530c7229c442fd3f31b7db2');
		const Weth = new web3.eth.Contract(wethAbi.abi, '0xd0a1e359811322d97991e03f863a0c30c2cf029c');
		const Peth = new web3.eth.Contract(pethAbi.abi, '0xf4d791139ce033ad35db2b2201435fad668b1b64');
		const Dai = new web3.eth.Contract(pethAbi.abi, '0xc4375b7de8af5a38a93548eb8453a498222c4ff2');
		const Mkr = new web3.eth.Contract(pethAbi.abi, '0xc4375b7de8af5a38a93548eb8453a498222c4ff2');
		return [ Tub , Weth , Peth , Dai , Mkr ];

	} else if(chain == 'mainnet'){
		const Tub = new web3.eth.Contract(tubAbi.abi, '0xa71937147b55deb8a530c7229c442fd3f31b7db2');
		const Weth = new web3.eth.Contract(wethAbi.abi, '0xd0a1e359811322d97991e03f863a0c30c2cf029c');
		const Peth = new web3.eth.Contract(pethAbi.abi, '0xf4d791139ce033ad35db2b2201435fad668b1b64');
		const Dai = new web3.eth.Contract(pethAbi.abi, '0xc4375b7de8af5a38a93548eb8453a498222c4ff2');
		const Mkr = new web3.eth.Contract(pethAbi.abi, '0xc4375b7de8af5a38a93548eb8453a498222c4ff2');

		return [ Tub , Weth , Peth , Dai , Mkr ];
	}else{
		return [];
	}
}


/*
*	Utility Section
*
*/
function addGasBuffer(gas) {
	return gas += gasBuffer;
}

function padIndexToHex(i) {
	return web3.utils.padLeft(web3.utils.toHex(i),64)
}

function txData(txCount, address, gas, gasPrice, encodeABI, chainId, to){
	return {
		nonce: txCount,
	    from: address,
	    gasLimit: gas,
		gasPrice: gasPrice,
	    data: encodeABI,
	    chainId: chainId,
	    value: '0x',
	    to: to
	};
}

function txDataWithValue(txCount, address, gas, gasPrice, encodeABI, chainId, to, value){
	return {
		nonce: txCount,
	    from: address,
	    gasLimit: gas,
		gasPrice: gasPrice,
	    data: encodeABI,
	    chainId: chainId,
	    value: value,
	    to: to
	};
}

